import React from "react";

const HeadingWidget = ({
  widget,
  updateParagraphPreview
}) =>
    <div>
      {
        widget.text === "Heading 1" &&
      <h1>Heading Widget</h1>
      }
      {
        widget.text === "Heading 2" &&
        <h2>Heading Widget</h2>
      }
      {
        widget.text === "Heading 3" &&
        <h3>Heading Widget</h3>
      }
      {
        widget.text === "Heading 4" &&
        <h4>Heading Widget</h4>
      }
      <input/>
      {
        alert(widget.text)
      }
      <select onChange={e => updateParagraphPreview(widget, e.target.value)}>
        <option>Heading 1</option>
        <option>Heading 2</option>
        <option>Heading 3</option>
        <option>Heading 4</option>
      </select>
    </div>

export default HeadingWidget
